import React, {Component} from 'react';
import styled from 'styled-components';
const HeaderContainer = styled.div`
    width: 100%;
    'background-color': #90cc74;
    height: 40px;
`;

class Header extends Component {
    render(){
        return <HeaderContainer/>
    }
}

export default Header;
